    S /= rtp->KBOLTZ; /* -1.8784471379548613 */

    volfrac = 0.8;
    T = 2500.0;
    V = volfrac * rtp->V0;
    S = get_rtpress_entropy( V, T, rtp ); /* -0.016066633649871438 */
    S /= rtp->KBOLTZ; /* -1.1637015477678558 */

