    S /= rtp->KBOLTZ; /* -0.76424263003857285 */

    volfrac = 0.6;
    T = 5000.0;
    V = volfrac * rtp->V0;
    S = get_rtpress_entropy( V, T, rtp ); /* 0.010228437833469547 */
    S /= rtp->KBOLTZ; /* 0.74084274263333616 */

    volfrac = 0.8;
    T = 5000.0;
    V = volfrac * rtp->V0;
    S = get_rtpress_entropy( V, T, rtp ); /* 0.021941049097879431 */
    S /= rtp->KBOLTZ; /* 1.5891837301622371 */

    volfrac = 1.0;
